import React from "react";

import "./style.css";

const Header = () => {
  return (
    <div className="header row">
      <div className="col-6">
        <h2 className="header-title text-left">FARM MANAGEMENT</h2>
      </div>
      <div className="col-6">
        <button>My</button>
      </div>
    </div>
  );
};

export default Header;
